minikube is unable to connect to the VM::
minikube ne parvient pas à se connecter à la VM : {{.error}}

	Cela est probablement dû à l'une des deux raisons suivantes :

	- Interférence VPN ou pare-feu
	- {{.hypervisor}} problème de configuration réseau

	Solutions suggérées :

	- Désactivez votre logiciel VPN ou pare-feu local
	- Configurez votre VPN ou pare-feu local pour autoriser l'accès à {{.ip}}
 	- Redémarrez ou réinstallez {{.hypervisor}}
	- Utilisez un autre --vm-driver
	- Utilisez --force pour annuler cette vérification de connectivité
